import pandas as pd
import numpy as np

def merge_all_data(csv1, csv2, csv3, csv4):
    # Read the CSV files into DataFrames
    user_health_file = pd.read_csv(csv1)
    supplement_usage_file = pd.read_csv(csv2)
    experiments_file = pd.read_csv(csv3)
    user_profiles_file = pd.read_csv(csv4)

    # Convert date type and format
    user_health_file['date'] = pd.to_datetime(user_health_file['date'], format='%Y-%m-%d')
    supplement_usage_file['date'] = pd.to_datetime(supplement_usage_file['date'], format='%Y-%m-%d')

    # Merge supplement usage with experiments to get experiment_name
    supplement_usage_file = supplement_usage_file.merge(experiments_file[['experiment_id', 'name']], on='experiment_id', how='left')

    # Rename 'name' column to 'experiment_name'
    supplement_usage_file.rename(columns={'name': 'experiment_name'}, inplace=True)

    # Convert dosage to grams (assuming dosage_unit is 'mg', otherwise keep the original dosage)
    supplement_usage_file['dosage_grams'] = np.where(
        supplement_usage_file['dosage_unit'] == 'mg',
        supplement_usage_file['dosage'] / 1000,
        supplement_usage_file['dosage']
    )

    # Convert 'dosage_grams' to string and handle missing values
    supplement_usage_file['dosage_grams'] = supplement_usage_file['dosage_grams'].astype(float).round(1)

    # Merge user health data with supplement usage on 'user_id' and 'date'
    merged_data = pd.merge(user_health_file, supplement_usage_file, on=['user_id', 'date'], how='outer')

    # Merge with user profiles to get email and age group
    merged_data = pd.merge(merged_data, user_profiles_file, on='user_id', how='left')

    # Fill missing supplement columns for days without supplement intake
    merged_data['supplement_name'] = merged_data['supplement_name'].str.lower().str.replace('-', '_').str.replace(' ', '_')
    merged_data['supplement_name'] = merged_data['supplement_name'].fillna('No intake')
    merged_data['experiment_name'] = merged_data['experiment_name'].fillna('none')

    # Calculate user_age_group and handle missing values or values outside the specified bins
    age_bins = [0, 18, 25, 35, 45, 55, 65, np.inf]
    age_labels = ['Under 18', '18-25', '26-35', '36-45', '46-55', '56-65', 'Over 65']
    merged_data['user_age_group'] = pd.cut(merged_data['age'], bins=age_bins, labels=age_labels, right=False)
    merged_data['user_age_group'] = merged_data['user_age_group'].cat.add_categories('Unknown').fillna('Unknown')

    # Clean and convert other fields
    merged_data['sleep_hours'] = merged_data['sleep_hours'].str.extract('(\d+(\.\d+)?)')[0].astype(float)
    merged_data['average_heart_rate'] = merged_data['average_heart_rate'].astype(float).round(1)
    merged_data['average_glucose'] = merged_data['average_glucose'].astype(float).round(1)
    merged_data['activity_level'] = merged_data['activity_level'].astype(int)

    # Clean experiment name
    merged_data['experiment_name'] = merged_data['experiment_name'].str.lower().str.replace(' ', '_')

    # Ensure is_placebo is clean and correct
    merged_data['is_placebo'] = np.where(
        merged_data['supplement_name'] == 'placebo', 'true',
        np.where(
            merged_data['supplement_name'] == 'No intake', 'No intake',
            'false'
        )
    )

    # Select and reorder columns as specified
    final_columns = ['user_id', 'date', 'email', 'user_age_group', 'experiment_name', 'supplement_name',
                     'dosage_grams', 'is_placebo', 'average_heart_rate', 'average_glucose',
                     'sleep_hours', 'activity_level']

    final_data = merged_data[final_columns]

    return final_data

# Example usage:
