import pandas as pd
import numpy as np

def merge_all_data(csv1, csv2, csv3, csv4):
    # Read the CSV files into DataFrames
    user_health_file = pd.read_csv(csv1)
    supplement_usage_file = pd.read_csv(csv2)
    experiments_file = pd.read_csv(csv3)
    user_profiles_file = pd.read_csv(csv4)


    # Check and handle duplicates in each DataFrame
    user_health_file = user_health_file.dropna(subset=['user_id']).drop_duplicates(subset=['user_id'])
    supplement_usage_file = supplement_usage_file.dropna(subset=['user_id']).drop_duplicates(subset=['user_id'])
    user_profiles_file = user_profiles_file.dropna(subset=['user_id']).drop_duplicates(subset=['user_id'])


    #Convert date type and format
    user_health_file['date'] = pd.to_datetime(user_health_file['date'], format='%Y-%m-%d')
    supplement_usage_file['date'] = pd.to_datetime(supplement_usage_file['date'], format='%Y-%m-%d')

    #rename user supplement usage file date so that it wont conflict the user health file date
    supplement_usage_file.rename(columns={'date': 'supplement_usage_date'}, inplace=True)

    # Makes sure email has no duplciatesand missing value
    user_profiles_file = user_profiles_file.dropna(subset=['email']).drop_duplicates(subset=['email'])


    # Calculate user_age_group and handle missing values or values outside the specified bins
    age_bins = [0, 18, 25, 35, 45, 55, 65, np.inf]
    age_labels = ['Under 18', '18-25', '26-35', '36-45', '46-55', '56-65', 'Over 65']
    user_profiles_file['user_age_group'] = pd.cut(user_profiles_file['age'], bins=age_bins, labels=age_labels, right=False)
    # Replace values outside age_bins with 'Unknown'
    user_profiles_file['user_age_group'] = user_profiles_file['user_age_group'].cat.add_categories('Unknown').fillna('Unknown')


    # Rename experiment to experiment_name then clean it
    experiments_file.rename(columns={'name': 'experiment_name'}, inplace=True)
    experiments_file['experiment_name'] = experiments_file['experiment_name'].str.lower().str.replace(' ', '_')
    #clean suppliment usage file
    supplement_usage_file['supplement_name'] = supplement_usage_file['supplement_name'].str.lower().str.replace(' ', '_').str.replace('-', '_')


   #Make sure supliment name has No intake for missing Values    # Fill missing supplement columns for days without supplement intake
    supplement_usage_file['supplement_name'] = supplement_usage_file['supplement_name'].fillna('No intake')


    #Convert dosage to grams and missing val converted to nan
    supplement_usage_file['dosage_grams'] = np.where(supplement_usage_file['dosage_unit'] == 'mg',
                                                supplement_usage_file['dosage'] / 1000,
                                                supplement_usage_file['dosage'])
    supplement_usage_file['dosage_grams'] = supplement_usage_file['dosage_grams'].fillna(np.nan)


    #Ensure is_placebo is clean and all entry not Placebo in supplement_name is false
    supplement_usage_file['is_placebo'] = np.where(supplement_usage_file['supplement_name'].str.lower() == 'placebo','true', 'false')

    #Ensure average_heart_rate is clean and float
    user_health_file['average_heart_rate'] = user_health_file['average_heart_rate'].astype(float)
    #Ensure average_glucose is clean and float
    user_health_file['average_glucose'] = user_health_file['average_glucose'].astype(float).round(2)

    #Ensure sleep hours is clean and float
    user_health_file['sleep_hours'] = user_health_file['sleep_hours'].str.extract('(\d+(\.\d+)?)')[0].astype(float)

    #Ensure activity_level is clean and Int
    user_health_file['activity_level'] = user_health_file['activity_level'].astype(int)


    # Merge user_profiles_file with user_health_file on 'user_id'
    merged_data = user_profiles_file.merge(user_health_file, on='user_id', how='left')
    # Merge the result with supplement_usage_file on 'user_id'
    merged_data = merged_data.merge(supplement_usage_file, on='user_id', how='left')
    # Merge the result with experiments_file on 'experiment_id'
    merged_data = merged_data.merge(experiments_file, on='experiment_id', how='left')



    # Select and reorder columns as specified
    final_columns = ['user_id', 'date', 'email', 'user_age_group', 'experiment_name', 'supplement_name',
                     'dosage_grams', 'is_placebo', 'average_heart_rate', 'average_glucose',
                     'sleep_hours', 'activity_level']

    final_data = merged_data[final_columns]

    return final_data

